import * as React from 'react';
import { ProgressBar } from 'react-bootstrap';
import Chart from 'react-google-charts';
import 'bootstrap/dist/css/bootstrap.min.css';

export const data = [
    ["Category", "Utilities", "Entertainment", "Food", "Transportation", "Miscellaneous", "Rent"],
    ["", 200, 200, 400, 250, 350, 800],
  ];

export const options = {
    chart: {
      title: "Budget",
    },
  };


const Budget = () => {
    return (
        <div>
            This is the budget page
            <div>
                <Chart 
                chartType='BarChart'
                width="80%"
                height="400px"
                data={data}
                options={options}
                />
            </div>
        </div>
    )
}

export default Budget;
